INSERT INTO `place` VALUES (7,'홍대난타극장','난타전용관은 한국 최초로 세워진 전용극장이다. 난타전용관에서 공연하는 \'난타\'는 한국의 전통 가락인 사물놀이 리듬을 바탕으로 하여 주방에서 일어나는 일들을 코믹하게 드라마화한 비언어극이다.','서울특별시 마포구 서교동 양화로16길 29',NULL,'02','739','8288',1,'홍대',37.553,126.921,'data:image/jpeg;base64,'),(8,'홍대앞 예술시장 프리마켓','독립 예술가들이 가판대에서 수공예품과 예술작품을 판매하는 비상설 야외 시장으로 이벤트도 열립니다.','서울특별시 마포구 와우산로21길 19-3',NULL,'02','325','8553',1,'홍대',37.5521,126.923,'https://www.jungle.co.kr/image/c4413567447598ef3ea311eb'),(9,'경의선숲길공원','녹음이 우거진 공원으로 탈바꿈한 옛 철로로 산책로, 잔디밭, 시내가 있으며 인근에는 카페가 있습니다.','서울특별시 마포구 동교로51길 133',NULL,'02','719','8830',1,'홍대',37.5589,126.925,'https://parks.seoul.go.kr/images/egovframework/com/template/gus3.jpg');
